import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { ApiService } from 'src/app/service/Api.service';

@Component({
  selector: 'app-get-complaint-by-complaint-id',
  templateUrl: './get-complaint-by-complaint-id.component.html',
  styleUrls: ['./get-complaint-by-complaint-id.component.css'],
})
export class GetComplaintByComplaintIdComponent {
  complaintId!: number;
  data!: Component;

  constructor(private service: ApiService, private route: ActivatedRoute) {}

  ngOnInit(): void {
    this.route.paramMap.subscribe((params) => {
      this.complaintId = +params.get('complaintId')!;
    });
    this.service.getComplaintById(this.complaintId).subscribe((data: any) => {
      this.data = data;
    });
  }
}
<div class="sub-card">
  <div class="id">
    <p>complaintId</p>
    <span>{{ data.complaintId }}</span>
  </div>
  <div class="name">
    <p>productModelNumber</p>
    <span>{{ data.productModelNumber }}</span>
  </div>
  <div class="age">
    <p>complaintName</p>
    <span>{{ data.complaintName }}</span>
  </div>
  <div class="salery">
    <p>status</p>
    <span>{{ data.status }}</span>
  </div>
  <div class="department">
    <p>clientId</p>
    <span>{{ data.clientId }}</span>
  </div>
  <div class="department">
    <p>engineerId</p>
    <span>{{ data.engineerId }}</span>
  </div>
  <div class="department">
    <p>dateOfComplaint</p>
    <span>{{ data.dateOfComplaint }}</span>
  </div>
  <div class="department">
    <p>resolvedDate</p>
    <span>{{ data.resolvedDate }}</span>
  </div>
  <div class="department">
    <p>priority</p>
    <span>{{ data.priority }}</span>
  </div>
</div>
